script: |
  super -f text -I q12332.spq | sort > q12332.out

inputs:
  - name: q12332.spq
    data: |
      SELECT - col0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT 32 + + 15 >= - col0 * + 65 * + col2 + + 95 * - ( - col1 ) * + - ( - + col0 );
  - name: tab2

outputs:
  - name: q12332.out
    data: |
      -46
      -64
      -75
